    uint256 id;
    uint256 surveyId;
    string sentence;
    bool isBlank;
}

struct Answer {
    uint256 id;
    uint256 questionId;
    uint256 surveyId;
    address participantWalletAddress;
    bool value;
    bool isBlank;
}

struct Earning {
    uint256 id;
    uint256 surveyId;
    address recipientWalletAddress;
    uint256 amountPaidOutInWei;
    bool isBlank;
}

struct Funding {
    uint256 id;
    uint256 surveyId;
    address creatingResearcherWalletAddress;
    uint256 amountFundedInWei;
    bool isBlank;
}

